import Navbar from '../components/Navbar';



const About = () => (
    <div>
        <Head>
            <title>
                Bitzprize
            </title>
        </Head>
        <Navbar />
        <h1>About page</h1>
        <p>Application to view page</p>
 
     





    </div>
);





export default About;
